import MovieCard from './MovieCard'

const MovieList = ({ movies }) => {
  return ( 
    <>
    <h1>Movie List</h1>
    <div style={{display:"flex", justifyContent:"space-around", "flexWrap":"wrap", gap:"60px", margin:"25px"}}> 
      {movies.map((movie) => (
        <MovieCard key={movie.id} movie={movie} />
      ))}
    </div>
    </>
  )
}

export default MovieList
